import React from "react";
import { useEffect, useState } from "react";
import axios from "axios";

const ViewDetails = (id) => {
    const [display, setDisplay] = useState(false);

    const onClick = () => {
        setDisplay(true);
    };

    if (display){
        return <button display={display}>clicked!</button>;
    }
    return <button onClick={onClick}>click for {id} details</button>;
};

const Userlist = () => {
    const [Users, setUsers] = useState([]);

     React.useEffect(() => {
        axios.get("http://127.0.0.1:5000/userlist").then((response) => {
        console.log(response.data);
        setUsers(response.data);
    });
    });

    return (
    <ul>
        <div>
        <ViewDetails id={5}/>
        </div>
    </ul>
    );
};

const App = () => {
    return(
        <div>
        <Userlist />
        </div>
    );
};

export default App;
